import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        {/* Logo inserted in place of the "Home" link */}
        <a className="navbar-brand" href="#">
          <img src="path-to-your-logo.png" alt="Logo" width="40" height="40" /> {/* Adjust logo size */}
        </a>
        
        {/* Navigation links */}
        <Link className="navbar-brand" to="/customer-booth">Customer Booth</Link>
        <Link className="navbar-brand" to="/employee-booth">Employee Booth</Link>
        <Link className="navbar-brand" to="/admin-booth">Admin Booth</Link>

        {/* Navbar toggle button for mobile view */}
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Navbar collapse (contains links for smaller screens) */}
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav ms-auto mb-2 mb-lg-0">
            {/* You can add other links here if needed */}
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
